    <style>
        body, html { margin:0; padding:0; height:100%; width:100%; background:#1a1a1a; overflow: hidden; -webkit-tap-highlight-color: transparent; }
        #vfs-iframe { width: 100%; height: 100%; border: none; display: none; background: white; }
        
        #shroud { 
            position: fixed; top: 0; left: 0; width: 100%; height: 100%; 
            display: flex; flex-direction: column; justify-content: center; align-items: center; 
            background: #f4f1de; transition: opacity 1s; z-index: 9999; 
            overflow: hidden; cursor: pointer; touch-action: manipulation; user-select: none; -webkit-user-select: none;
        }

        #marquee { width: 100%; overflow: hidden; position: relative; }
        .marquee-content { display: inline-flex; align-items: center; animation: marquee 14s linear infinite; font-size: 3rem; white-space: nowrap; }
        .horse-group { display: inline-flex; position: relative; margin-right: 40px; width: 260px; height: 100px; align-items: center; }
        .horse { position: absolute; font-size: 2.8rem; animation: gallop 0.6s ease-in-out infinite alternate; }
        .horse-1 { left: 0; z-index: 3; animation-delay: 0.1s; }
        .horse-2 { left: 80px; z-index: 2; animation-delay: 0.25s; }
        .horse-3 { left: 160px; z-index: 1; animation-delay: 0.4s; }

        #text-wrapper { display: inline-flex; align-items: center; }
        .char { display: inline-block; opacity: 0; transform: translateY(15px); animation: charIn 0.8s ease forwards; margin-right: 12px; }

        /* ÂÖ®ÂüüÊá∏ÊµÆÊåâÈàïÊ®£Âºè */
        #global-nav {
            position: fixed;
            top: 20px;
            left: 20px;
            z-index: 10000;
            display: none; /* Áî± JS ÊéßÂà∂È°ØÁ§∫ */
            touch-action: none;
        }

        .nav-btn {
            background: rgba(255, 255, 255, 0.2); 
            width: 60px; height: 60px;
            border-radius: 12px;
            border: 2px solid rgba(31, 41, 55, 0.5); 
            display: flex; flex-direction: column;
            justify-content: center; align-items: center;
            backdrop-filter: blur(12px); 
            -webkit-backdrop-filter: blur(12px);
            cursor: move;
            box-shadow: 0 4px 15px rgba(0,0,0,0.1);
            transition: transform 0.2s;
            padding: 0; margin: 0;
        }

        .nav-btn:active { transform: scale(0.9); }

        .outline-text {
            color: #1f2937; 
            text-shadow: -1px -1px 0 #FFFF00, 1px -1px 0 #FFFF00, -1px 1px 0 #FFFF00, 1px 1px 0 #FFFF00;
            font-size: 0.7rem; font-weight: 900; line-height: 1; margin-top: 2px;
        }

        @keyframes marquee { 0% { transform: translateX(100vw); } 100% { transform: translateX(-100%); } }
        @keyframes gallop { from { transform: translate(0, -5px) rotate(-3deg); } to { transform: translate(0, 5px) rotate(3deg); } }
        @keyframes charIn { to { opacity: 1; transform: translateY(0); } }
    </style>
</head>

            const _S = "GLIMMER_SECRET_SEED_0.4925089884684545";
            let _VFS = null;
            let _clicks = [];

            // 1. ÂãïÁï´ËàáÊñáÂ≠óÂàùÂßãÂåñ
            const text = "ÈÄöÈóúÂØÜÁ¢º";
            const textWrapper = document.getElementById('text-wrapper');
            text.split('').forEach((char, i) => {
                const span = document.createElement('span');
                span.className = 'char';
                span.innerText = char;
                span.style.color = ['#e07a5f', '#3d405b', '#81b29a', '#f2cc8f'][i%4];
                span.style.animationDelay = (1.0 + i * 0.45) + 's';
                textWrapper.appendChild(span);
            });

            // 2. ÊãñÊõ≥ËàáÂõûÈ¶ñÈ†ÅÈÇèËºØ
            const nav = document.getElementById('global-nav');
            const homeBtn = document.getElementById('global-home-btn');
            let isDragging = false, hasMoved = false, startX, startY, initialLeft, initialTop;

            const startDrag = (e) => {
                isDragging = true; hasMoved = false;
                const c = e.type.includes('touch') ? e.touches[0] : e;
                startX = c.clientX; startY = c.clientY;
                initialLeft = nav.offsetLeft; initialTop = nav.offsetTop;
            };
            const doDrag = (e) => {
                if (!isDragging) return;
                const c = e.type.includes('touch') ? e.touches[0] : e;
                const dx = c.clientX - startX, dy = c.clientY - startY;
                if (Math.abs(dx) > 5 || Math.abs(dy) > 5) hasMoved = true;
                
                let nL = initialLeft + dx, nT = initialTop + dy;
                // ÈÇäÁïåÊ™¢Êü•
                nL = Math.max(10, Math.min(nL, window.innerWidth - 70));
                nT = Math.max(10, Math.min(nT, window.innerHeight - 70));
                
                nav.style.left = nL + 'px';
                nav.style.top = nT + 'px';
            };

            nav.addEventListener('mousedown', startDrag);
            window.addEventListener('mousemove', doDrag);
            window.addEventListener('mouseup', () => isDragging = false);
            nav.addEventListener('touchstart', startDrag, {passive:true});
            window.addEventListener('touchmove', (e) => { if(isDragging) e.preventDefault(); doDrag(e); }, {passive:false});
            window.addEventListener('touchend', () => isDragging = false);

            homeBtn.onclick = () => { if(!hasMoved) render('index.html'); };

            // 3. Ëß£ÂØÜËàáÊ∏≤Êüì
            const shroud = document.getElementById('shroud');
            shroud.onclick = () => {
                const now = Date.now();
                _clicks.push(now);
                _clicks = _clicks.filter(t => now - t < 2000);
                if (_clicks.length >= 6) unlock();
            };

            async function unlock() {
                if (_VFS) return;
                try {
                    const decrypted = await decryptData(_P, _S);
                    _VFS = JSON.parse(decrypted);
                    shroud.style.opacity = '0';
                    setTimeout(() => {
                        shroud.style.display = 'none';
                        document.getElementById('vfs-iframe').style.display = 'block';
                        render('index.html');
                    }, 1000);
                } catch(e) { alert("Ëß£ÂØÜÂ§±Êïó"); }
            }

            function render(filename) {
                if (!_VFS[filename]) return;
                
                // Ëá™ÂãïÈö±ËóèÈ¶ñÈ†ÅÊåâÈàïÈÇèËºØ
                nav.style.display = (filename.toLowerCase() === 'index.html') ? 'none' : 'block';

                const iframe = document.getElementById('vfs-iframe');
                const bin = atob(_VFS[filename]);
                const bytes = new Uint8Array(bin.length);
                for(let i=0; i<bin.length; i++) bytes[i] = bin.charCodeAt(i);
                const html = new TextDecoder().decode(bytes);
                const doc = iframe.contentDocument || iframe.contentWindow.document;
                doc.open();
                doc.write(html);
                doc.close();

                iframe.onload = () => {
                    const iDoc = iframe.contentDocument || iframe.contentWindow.document;
                    iDoc.querySelectorAll('a').forEach(link => {
                        link.onclick = (e) => {
                            const href = link.getAttribute('href');
                            if (!href) return;
                            const cleanHref = href.replace(/^\.\//, '');
                            if (_VFS[cleanHref]) { e.preventDefault(); render(cleanHref); }
                        };
                    });
                };
            }

            async function decryptData(pkg, seed) {
                const enc = new TextEncoder();
                const b64ToUint8 = (b64) => {
                    const bin = atob(b64);
                    const bytes = new Uint8Array(bin.length);
                    for (let i = 0; i < bin.length; i++) bytes[i] = bin.charCodeAt(i);
                    return bytes;
                };
                const iv = b64ToUint8(pkg.iv), data = b64ToUint8(pkg.data);
                const keyMat = await crypto.subtle.importKey("raw", enc.encode(seed), {name:"PBKDF2"}, false, ["deriveKey"]);
                const key = await crypto.subtle.deriveKey(
                    { name:"PBKDF2", salt:enc.encode("salt-vfs"), iterations:100000, hash:"SHA-256" },
                    keyMat, { name:"AES-GCM", length:256 }, false, ["decrypt"]
                );
                const res = await crypto.subtle.decrypt({ name:"AES-GCM", iv:iv }, key, data);
                return new TextDecoder().decode(res);
            }
        })();
